import React from 'react';
import PowerButtonRive from './Rive-Components/START.animation';
import {Link, useHistory} from 'react-router-dom'

const Home = () =>{

    const history = useHistory()


    const handleClick = (e) => {

        setTimeout(() => {
            history.push('/1')
            }, 2000);

    }


    return(
        <div style ={{
            backgroundColor:'rgb(3,15,22)', 
            with:'100vw',
            height:'100vh',
            color:'white'
        }}>
            <PowerButtonRive
                onClick={(e)=>handleClick}
            />
        </div>
    )
}

export default Home
